            <div>
                <Link to='/'>Home</Link>
                <Link to='/clothing'>Clothing</Link>
                <Link to='/electronics'>Electronics</Link>
                <Link to='/jewelery' src={jewelery} >Jewelery </Link>
            </div>

        )
    }
}

export default Nav
